import React, { Component } from 'react'
export default class About extends Component {
  render() {
    return (
      <div className='about'>
        <img src='./intro.jpg' alt="" style={{width:"1300px", height:"600px", opacity:"0.7"}}/>
        <div className='you'>
          <div><div><div>
            <img src="./photo.jpg" alt="" /></div></div></div>
        </div>
      </div>
    )
  }
}
